import React from "react"
import styled from 'styled-components'

const BoxParag = styled.div`
display:flex;
margin-right: auto !important;
flex-wrap: wrap;


`
const DivParag = styled.div`
flex: 0 0 66.66667%;
max-width: 66.66667%;
position: relative;

    padding-right: 15px;
    padding-left: 15px;
`
const Parag = styled.p`
    margin-top: 0;
	margin-bottom: 1rem;
	display: block;
    margin-block-start: 1em;
    margin-block-end: 1em;
    margin-inline-start: 0px;
	margin-inline-end: 0px;
`
const HeaderBoxContact = styled.div`
text-align: center;
color :rgba(0, 0, 0, 0.5);
margin-right: 15px;
margin-left: 15px;

`

const PageIntro = ({text}) =>(
            <HeaderBoxContact>
			<Parag>{text}</Parag>
			</HeaderBoxContact>

)
export default PageIntro
